import { Fragment } from "react/cjs/react.production.min";

import classes from "./Header.module.css";
import image from "../Images/pix1.webp";
import Button from "./Button";
import { useState } from "react";
const Header = () => {
  const [showCart, setShowCart] = useState(false);

  const clickChangeHandler = () => {
    setShowCart(true);
  };
  return (
    <Fragment>
      <div className={classes.container}>
        <span>
          <p>Boss Miracle</p>
          <h3>
            What <span style={{ color: "orange" }}>would you </span>like to
            Order?
          </h3>
        </span>
        <Button onClickNow={clickChangeHandler} />
        <img src={image} alt="human picture" className={classes.images} />
      </div>
    </Fragment>
  );
};

export default Header;
